import React from 'react';
import './css/UI.css'

function List(){
  const title="m";
  const desc="xfbvdfgsfg";
  const title1="2sz";
  const desc1="second";
  return(
    <div className="list">
    <div className="title">{title}</div>
    <div className="desc">{desc}</div>
    <div className="title">{title1}</div>
    <div className="desc">{desc1}</div>
    </div>
  );
}
export default List;
